Ever play an MMORPG like World of Warcraft, Wildstar, or Everquest ? Ever play a Healer? No ? Well you're in luck!

Healing Simulator puts you in the shoes of ACTUAL healers where you get to see NONE of the awesome graphics of your typical role playing game and only stare at health bars and battle text!

Take control in this half role playing - half puzzle - half simulator - all healer game and defeat the evil..um..ENEMIES ! Take on over 25 encounters ranging from stupidly easy, to insanely hard and keep your party alive! If you've managed to conquer the encounters ( You are Epic! ) head to the DUNGEON RUN mode and try to keep everyone alive as long as possible and then compare your time against your facebook friends and the developers!

We will be considering updating with more Encounters and Modes if you find this enjoyable : )

Note : The facebook feature is under review and will be live soon! Your scores will still be saved and active so POST THEM ON YOUR TIMELINE to compare against friends!
